INSERT INTO `#__jshopmenu_categories` (`category_id`, `name`, `short_name`, `short_description`, `description`, `slug`, `published`, `ordering`, `image`, `koll_person`, `file`, `params`) VALUES
(1, 'Банкетное меню', 'Банкетное меню', 'Организовывая праздник, особое внимание нужно уделить еде.', '<h1>Правильно подобранное банкетное меню &ndash; залог успешного мероприятия</h1>\r\n<p><strong><span id="transmark"></span></strong></p>\r\n<p>Организовывая праздник, особое внимание нужно уделить еде. Очень важно, чтобы гость покидал событие с полным желудком. Только в этом случае о празднике останется хорошее впечатление. А чтобы гость был удовлетворен, нужно правильно подобрать банкетное меню. Эта статья поможет грамотно подойти к подбору блюд и правильно рассчитать количество еды.</p>\r\n<p><strong>Моменты, которые нужно учитывать при составлении банкетного меню</strong></p>\r\n<p>Как правило, когда люди обращаются в рестораны, кейтеринговые компании, то расчет количества и разнообразие блюд предлагает менеджер или администратор. Этим специалистам следует доверять, так как они профи в этой сфере. Но все же заказчикам предварительно нужно узнать все факторы, влияющие на подбор меню и нюансы выбора. Следующие рекомендации помогут грамотно подойти к его подбору:</p>\r\n<p>1. Перед составлением меню, нужно посчитать гостей и определить, кого больше: пожилых гостей или молодежи. Если преобладает число взрослых, то меню должно быть классическое. Если же молодежи больше, то тут с блюдами можно поэкспериментировать, но не увлекаясь. Если на свадьбе будет много детей, то для них нужно составить отдельное меню.</p>\r\n<p>2. Обязательно нужно учесть время года, когда проходит мероприятие. Если событие состоится зимой, то следует включить в меню больше горячих блюд. В это время года гости больше едят. Летом же нужно делать акцент на напитках, легких закусках, предложить много разновидностей салатов, а вот горячих блюд может быть немного. Что касается алкогольных напитков, то летом они должны быть легкими, охлажденными, а зимой более крепкими.</p>\r\n<p>3. Обязательно нужно учесть, какие напитки предпочитают гости и, исходя из этого, купить определенные виды и марки.</p>\r\n<p>4. Еды должно хватить на всех приглашенных. Лучший вариант &ndash; это горячие блюда подавать порциями, тогда на всех хватит, а вот салаты можно подавать в общих тарелках или же в тарталетках. Второй вариант будет выглядеть эстетично и брать из общих тарелок будет удобно.</p>\r\n<p>5. Обязательно нужно протестировать несколько блюд, чтобы точно знать, что Вам будут подавать к столу.</p>\r\n<p><strong>Как рассчитать количество еды?</strong></p>\r\n<p>Составление банкетного меню &ndash; это ответственный момент. Обратившись в нашу компанию &laquo;Кейтеринг Банкет&raquo;, можете быть уверенными в том, что Вас обслужат на достойном уровне. При этом стоимость блюд и своевременной подачи будет одна из приемлемых по всей Москве.</p>\r\n<p>При составлении меню, мы учитываем несколько стандартных для всех служб правил в расчете порций. Они следующие:</p>\r\n<p>- в среднем, общее количество еды на человека составляет 1500 грамм;</p>\r\n<p>- в начале банкета подаются холодные закуски &ndash; до 400 грамм. Наименований может быть от 3 до 6, включая сыры, мясные и рыбные нарезки, свежие овощи и различные соления;</p>\r\n<p>- должно быть около 3&ndash;5 видов салата, с суммарным весом 250 грамм на человека. Традиционно подаются &laquo;Оливье&raquo;, &laquo;Мимоза&raquo;, &laquo;Под шубой&raquo;, &laquo;Цезарь&raquo;;</p>\r\n<p>- горячие закуски &ndash; блюда подаются через 30 минут после начала банкета. Суммарный вес &ndash; 200 грамм, а наименований может быть 2&ndash;3. Можно подавать жульен, запечённые овощи, а также горячие салаты;</p>\r\n<p>- горячие блюда из мяса &ndash; подаются они через 1,5 часа после подачи горячих закусок. Суммарный вес &ndash; около 250 грамм. Разновидностей может быть до 4 штук, при этом подается мясо рыбы, курицы, свинины с гарниром;</p>\r\n<p>- что касается фруктов, то нужно закупать с расчетом 200 грамм на человека. При этом ставить их на стол можно с самого начала банкета или уже подавать после горячих блюд перед десертом;</p>\r\n<p>- что касается десерта, то он подается через 1,5 часа после подачи горячих блюд. На каждого человека делается расчет в 200 грамм. Наименований должно быть как минимум</p>', 'banketnoe-menyu', 1, 1, '/media/com_jshopmenu/images/categories/image-category-1.jpg', 20, '{"1":"\\/media\\/com_jshopmenu\\/menu-files\\/banket\\/ban_eco.PDF","2":"","3":"","4":""}', '{"show_category_short_description":"","show_category_description":"","show_category_image":"","category_color_block":"","category_color_text":"","category_type_efeckt":"","category_color_sub_block":"","category_number_menu_type":"","category_load_menu_type":"","category_koef_obslujivanie":"","category_min_koll_person":"","category_max_koll_person":""}'),
